import React, { useEffect, useState } from 'react';
import '../../Style.css';
import { Box, Typography, Button, Modal, TextField, IconButton, Autocomplete, Tab, Tabs } from '@mui/material';
import axios from 'axios';
import { styled } from '@mui/material/styles';
import SearchIcon from '@mui/icons-material/Search';
import CloseIcon from '@mui/icons-material/Close';
import ChevronRight from '@mui/icons-material/ChevronRight';
import EditIcon from '@mui/icons-material/Edit';

const AddButton = styled(Button)({
  borderRadius: 3,
  padding: '21px 20px',
  boxShadow: 'none',
  textTransform: 'none',
  fontSize: 16,
  backgroundColor: '#0f72bd',
  lineHeight: 1.5,
  borderColor: '#0f72bd',
  color: '#ffffff',
  fontFamily: [
    '-apple-system',
    'BlinkMacSystemFont',
    '"Segoe UI"',
    'Roboto',
    '"Helvetica Neue"',
    'Arial',
    'sans-serif',
    '"Apple Color Emoji"',
    '"Segoe UI Emoji"',
    '"Segoe UI Symbol"',
  ].join(','),
  '&:hover': {
    backgroundColor: '#004f8a',
    borderColor: '#004f8a',
    boxShadow: 'none',
  },
  '&:active': {
    boxShadow: 'none',
    backgroundColor: '#0f72bd',
    borderColor: '#0f72bd',
  },
  '&:focus': {
    boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
  },
});
const CancelButton = styled(Button)({
  borderRadius: 3,
  padding: '21px 20px',
  boxShadow: 'none',
  textTransform: 'none',
  fontSize: 16,
  backgroundColor: '#ededed',
  lineHeight: 1.5,
  borderColor: '#0f72bd',
  color: '#505e71',
  fontFamily: [
    '-apple-system',
    'BlinkMacSystemFont',
    '"Segoe UI"',
    'Roboto',
    '"Helvetica Neue"',
    'Arial',
    'sans-serif',
    '"Apple Color Emoji"',
    '"Segoe UI Emoji"',
    '"Segoe UI Symbol"',
  ].join(','),
  '&:hover': {
    backgroundColor: '#e0e0e0',
    borderColor: '#e0e0e0',
    boxShadow: 'none',
  },
  '&:active': {
    boxShadow: 'none',
    backgroundColor: '#e0e0e0',
    borderColor: '#e0e0e0',
  },
  '&:focus': {
    boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
  },
});
const ListButton = styled(Button)({
  borderRadius: 0,
  width:'100%',
  padding: '21px 50px',
  justifyContent: 'space-between',
  boxShadow: 'none',
  textTransform: 'none',
  fontSize: 20,
  fontWeight: '300',
  backgroundColor: '#fffff',
  lineHeight: 1.5,
  borderColor: '#0f72bd',
  color: '#505e71',
  fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
  ].join(','),
  '&:hover': {
      backgroundColor: '#e0e0e0',
      borderColor: '#e0e0e0',
      boxShadow: 'none',
  }
});
const AntTabs = styled(Tabs)({
  display: 'flex',
  height: '100%',
  borderBottom: '1px solid #e8e8e8',
  '& .MuiTabs-indicator': {
    backgroundColor: '#1890ff',
  },
});

const AntTab = styled((props) => <Tab disableRipple {...props} />)(({ theme }) => ({
  minHeight: '100px',
  borderBottom: '1px solid #edf2f6',
  textTransform: 'none',
  minWidth: 0,
  [theme.breakpoints.up('sm')]: {
    minWidth: 0,
  },
  fontWeight: theme.typography.fontWeightRegular,
  marginRight: theme.spacing(1),
  color: 'rgba(0, 0, 0, 0.85)',
  fontFamily: [
    '-apple-system',
    'BlinkMacSystemFont',
    '"Segoe UI"',
    'Roboto',
    '"Helvetica Neue"',
    'Arial',
    'sans-serif',
    '"Apple Color Emoji"',
    '"Segoe UI Emoji"',
    '"Segoe UI Symbol"',
  ].join(','),
  '&:hover': {
    color: '#40a9ff',
    opacity: 1,
  },
  '&.Mui-selected': {
    color: '#1890ff',
    fontWeight: theme.typography.fontWeightMedium,
  },
  '&.Mui-focusVisible': {
    backgroundColor: '#d1eaff',
  },
}));
const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: '100%',
  height: '100%',
  backgroundColor: 'white',
};

function TowerCrane() {
  const [tabValue, setTabValue] = React.useState('one');
  const handleChange = (event, newValue) => {
    setTabValue(newValue);
  };

  const [craneAssets, setCraneAssets] = useState([]);

  const [assetID, setAssetID] = useState();
  const [assetName, setAssetName] = useState('');
  const [assetEquipmentType, setAssetEquipmentType] = useState('');
  const [assetModel, setAssetModel] = useState('');
  const [assetMake, setAssetMake] = useState('');
  const [assetSupplier, setAssetSupplier] = useState('');

  const [customName, setCustomName] = useState();
  const [make, setMake] = useState();
  const [model, setModel] = useState();
  const [equipmentType, setEquipmentType] = useState();
  const options = [
    'Luffer',
    'Hammerhead'
  ];
  //const [equipmentType, setEquipmentType] = useState();

  const [open, setOpen] = useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const [openSetName, setOpenSetName] = useState(false);
  const handleOpenSetName = () => setOpenSetName(true);
  const handleCloseSetName = () => setOpenSetName(false);

  const [openSetType, setOpenSetType] = useState(false);
  const handleOpenSetType = () => setOpenSetType(true);
  const handleCloseSetType = () => setOpenSetType(false);

  const [openSetMakeModel, setOpenSetMakeModel] = useState(false);
  const handleOpenSetMakeModel = () => setOpenSetMakeModel(true);
  const handleCloseSetMakeModel = () => setOpenSetMakeModel(false);

  const showAssets = () => {
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.get('http://127.0.0.1:8000/api/assets/crane', {
        headers: headers
      })
      .then((res) => {
        setCraneAssets(res.data.data);
      })
    } catch(e) {
      console.log(e);
    }
  }
  const showAsset = (id) => {
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.get('http://127.0.0.1:8000/api/asset/'+id, {
        headers: headers
      })
      .then((res) => {
        setAssetID(res.data.data.id);

        setAssetName(res.data.data.custom_name);
        setCustomName(res.data.data.custom_name);

        setAssetEquipmentType(res.data.data.equipment_type);
        setEquipmentType(res.data.data.equipment_type);

        setAssetMake(res.data.data.make);
        setMake(res.data.data.make);

        setAssetModel(res.data.data.model);
        setModel(res.data.data.model);

        setAssetSupplier(res.data.data.supplier);
      })
    } catch(e) {
      console.log(e);
    }
  }
  const searchAsset = (custom_name) => {
    setCraneAssets([]);
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    if(custom_name !== "") {
      try {
        axios.get('http://127.0.0.1:8000/api/asset/search/crane/'+custom_name, {
          headers: headers
        })
        .then((res) => {
          if(res.data.data.length > 0) {
            setCraneAssets(res.data.data);
            showAsset(res.data.data[0].id);
          } else {
            setAssetID('');
            setAssetName('');
            setCustomName('');
            setAssetEquipmentType('');
            setEquipmentType('');
            setAssetMake('');
            setMake('');
            setAssetModel('');
            setModel('');
          }
        })
      } catch(e) {
        console.log(e);
      }
    } else {
      showAssets();
      showAsset_onLoad();
    }
  }
  const showAsset_onLoad = () => {
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.get('http://127.0.0.1:8000/api/assets/crane', {
        headers: headers
      })
      .then((res) => {
        setAssetID(res.data.data[0].id);
        showAsset(res.data.data[0].id);
      })
    } catch(e) {
      console.log(e);
    }
  }
  const addAsset = () => {
    const data = {
      custom_name: customName,
      make: make,
      model: model,
      type: 'crane',
      equipment_type: equipmentType,
    };
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.post('http://127.0.0.1:8000/api/assets', data, {
        headers: headers
      })
      .then((res) => {
        console.log(res.data.message);
        handleClose();
        showAssets();
        showAsset_onLoad();
      })
    } catch(e) {
      console.log(e);
    }
  };
  const editAssetName = () => {
    const data = {
      custom_name: customName,
    };
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.put('http://127.0.0.1:8000/api/asset/'+assetID+'/edit-name', data, {
        headers: headers
      })
      .then((res) => {
        console.log(res.data.message);
        handleCloseSetName();
        showAssets();
        showAsset(assetID);
      })
    } catch(e) {
      console.log(e);
    }
  }
  const editAssetType = () => {
    const data = {
      equipment_type: equipmentType,
    };
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.put('http://127.0.0.1:8000/api/asset/'+assetID+'/edit-type', data, {
        headers: headers
      })
      .then((res) => {
        console.log(res.data.message);
        handleCloseSetType();
        showAssets();
        showAsset(assetID);
      })
    } catch(e) {
      console.log(e);
    }
  }
  const editAssetMakeModel = () => {
    const data = {
      make: make,
      model: model
    };
    const headers = {
      'Content-Type': 'application/json',
      'Authorization': `Bearer ${localStorage.getItem('token')}`,
    };
    try {
      axios.put('http://127.0.0.1:8000/api/asset/'+assetID+'/edit-make-model', data, {
        headers: headers
      })
      .then((res) => {
        console.log(res.data.message);
        handleCloseSetMakeModel();
        showAssets();
        showAsset(assetID);
      })
    } catch(e) {
      console.log(e);
    }
  }
  useEffect(() => {
    showAssets();
    showAsset_onLoad(); // eslint-disable-next-line
  }, [])

  return (
    <>
      <Box sx={{
          position: 'relative', 
          width: 415,
          maxWidth: 415,
          paddingBottom: '100px',
          boxShadow: '3px 3px 7px rgba(103, 162, 206, 0.2)', 
          zIndex: 5,
        }}
      >
        <Box display="flex" sx={{
          height: '75px',
          borderBottom: 2,
          borderColor: '#edf2f6',
          alignItems: 'center',
          justifyContent: 'center',
        }}>
          <Box borderRight={2} borderColor='#e0e0e0' sx={{display: 'flex', width:100, height:75}}>
            <Button sx={{flexDirection: 'column', width: '100%', height: '100%'}}>
                <Box border={2} borderColor='#9cb1cd' sx={{width: '20px', marginBottom: '2px', borderRadius: 1}}/>
                <Box border={2} borderColor='#9cb1cd' sx={{width: '13px', marginBottom: '2px', borderRadius: 1}}/>
                <Box border={2} borderColor='#9cb1cd' sx={{width: '5px', borderRadius: 1}}/>
            </Button>
          </Box>
          <TextField
            sx={{width: '100%', margin: '0 5px'}}
            placeholder='Search Tower Cranes...'
            InputProps={{
              endAdornment: (
                <SearchIcon/>
              ),
            }}
            onChange={(e) => searchAsset(e.target.value)}
            />
        </Box>
        <Box display="flex" sx={{
          height: '100%',
        }}>
          <Box display="flex" sx={{height: '100%'}}>
            <div style={{ width: 415, overflow: "hidden", overflowY: 'scroll', height: 'calc(100% - 75px)'}}>
              {
                craneAssets.map((craneAssets) => (
                  <Box sx={{display: 'flex', minHeight: 100, borderBottom: 2, borderBottomColor: '#edf2f6'}} key={craneAssets['id']}>
                    <ListButton onClick={() => showAsset(craneAssets['id'])}>{craneAssets.custom_name}<ChevronRight/></ListButton>
                  </Box>
                ))
              }
            </div>
            <Box display="flex" justifyContent="center" alignItems="center" sx={{position: 'fixed', bottom: 0, height: '100px', width: 415, padding: '15px 20px', borderTop: 2, borderTopColor: '#edf2f6'}}>
              <AddButton sx={{width: '100%', height: '100%'}} onClick={() => handleOpen()}>Add Crane</AddButton>
            </Box>
          </Box>
        </Box>
      </Box>
      <Box sx={{display: 'flex', width: '100%'}}>
        <Box sx={{
          width: 415,
          maxWidth: 415,
          height: '100%',
          paddingBottom: '100px',
          boxShadow: '3px 3px 7px rgba(103, 162, 206, 0.2)', 
          zIndex: 5,
        }}
        >
          <Box sx={{
            padding: '30px',
            borderBottom: 1,
            borderBottomColor: '#edf2f6'
          }}>
            <Box sx={{
              minHeight: '215px',
              borderRadius: '3px',
              border: 1,
              borderColor: '#edf2f6',
              backgroundColor: '#f9fbfd',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              marginBottom: '25px'
            }}>

            </Box>
            <Box sx={{
              display: 'flex',
              flexDirection: 'column',
              justifyContent: 'center',
              textAlign: 'center',
            }}>
              <Typography sx={{color: '#505e71', fontWeight: 300, fontSize: '1.5rem'}}>{assetName ? assetName : 'N/A'}</Typography>
            </Box>
          </Box>
          <Box sx={{
            display: 'flex',
            padding: '15px 20px',
            borderBottom: 1,
            borderBottomColor: '#edf2f6'
          }}>
            <Typography sx={{display: 'inline-block', fontWeight: 300, fontSize: '0.875rem', color: '#889ab1'}}>Crane Settings</Typography>
          </Box>
          <Box>
            <AntTabs
              variant='scrollable'
              orientation='vertical'
              value={tabValue}
              onChange={handleChange}
              TabIndicatorProps={{
                sx: {
                  left: 0,
                  width: 3,
                  borderRadius: 2,
                }
              }}
            >
              <AntTab value="one" label={
                  <React.Fragment>
                    <Box sx={{display: 'flex', flexDirection: 'row', justifyContent: 'space-between', width: '100%'}}>
                      <Box sx={{width: '30px', height: '30px', backgroundColor: 'red'}}></Box>
                      <Typography>Crane Info</Typography>
                      <Box sx={{width: '30px', height: '30px', backgroundColor: 'red'}}></Box>
                    </Box>
                  </React.Fragment>
                }
              />
              <AntTab value="two" label={
                  <React.Fragment>
                    <Box sx={{display: 'flex', flexDirection: 'row', justifyContent: 'space-between', width: '100%'}}>
                      <Box sx={{width: '30px', height: '30px', backgroundColor: 'red'}}></Box>
                      <Typography>Location</Typography>
                      <Box sx={{width: '30px', height: '30px', backgroundColor: 'red'}}></Box>
                    </Box>
                  </React.Fragment>
                }
              />
              <AntTab value="three" label={
                  <React.Fragment>
                    <Box sx={{display: 'flex', flexDirection: 'row', justifyContent: 'space-between', width: '100%'}}>
                      <Box sx={{width: '30px', height: '30px', backgroundColor: 'red'}}></Box>
                      <Typography>Capacity Matrix</Typography>
                      <Box sx={{width: '30px', height: '30px', backgroundColor: 'red'}}></Box>
                    </Box>
                  </React.Fragment>
                }
              />
            </AntTabs>
          </Box>
        </Box>
